import React from "react";
import "./Login.css";
import { Formik , Form, FastField } from "formik";
import * as Yup from "yup";

const initialValues = {

}

const onSubmit = (values , submitProps) => {

}

const validationSchema = Yup.object({

})

const Login = () => {
    return (
        <div className="form-container">
            <Formik
            initialValues={initialValues}
            onSubmit={onSubmit}
            validationSchema={validationSchema}
            >
                {formik => {
                    return (
                        <Form className="loginForm w-75 mx-auto rounded-3 p-3 row">
                            <div className="col-12 text-center mb-4">
                                <i class="bi bi-person-circle large-icon"></i>
                            </div>
                            <div className="col-6 text-center fs-3">
                                Welcome! <br />
                                Please enter your username & password.
                            </div>
                            <div className="col-6">
                                <div className="my-3">
                                    <label for="username" class="form-label">Username</label>
                                    <FastField type="text" class="form-control" name="username" id="username" placeholder="Username" />
                                    <div class="valid-feedback">
                                            matne valid
                                    </div>
                                    <div class="invalid-feedback">
                                            matne invalid
                                    </div>
                                </div>
                                <div className="text-center mt-5">
                                    <button type="submit" className="btn btn-success btn-large">Submit</button>
                                </div>
                            </div>
                        </Form>
                    )
                }}

            </Formik>
        </div>
    )
}

export default Login;
